  false,\n\t\"url\": null,\n\t\"notes\": \"This coverage contains land-cover information
  for all of Ohio and portions of Indiana, Michigan, Kentucky, West Virginia, Pennsylvania,
  and New York. This dataset was derived from the U.S. Geological Survey's National
  Land Cover Dataset (NLCD). NLCD raster grids were downloaded from the USGS EROS
  Data Center web server at http://landcover.usgs.gov/natllandcover.html, by state.
  These grids were then reprojected, mosaiced and clipped against a polygon coverage
  representing the study area. Grid cell resolution is approximately 30 meters or
